import React from "react";
import styles from './MainPage.module.scss';

function MainPage (){
    return (
<section className={styles.mainPage__section}>
    <h1>Добро пожаловать в социальную сеть "Друзья"</h1>
    <button >Войти</button>
</section>
    )
}
export default MainPage;
